import React from "react";
import "./style.css";

function Hero() {
  return (
    <div className="jumbotron text-left">
      <h1 className="display-3">MERN Virtual Library</h1>
      <h3 className="lead">Powered by Google Books</h3>
      <p>Search and Save Books of Interest</p>
    </div>
  );
}

export default Hero;
